/*Table structure for table `scliente` */

CREATE TABLE `scliente` (
  `codclien` int(6) unsigned NOT NULL default '0',
  `nomclien` varchar(40) NOT NULL default '',
  `nomcomer` varchar(30) NOT NULL default '',
  `domclien` varchar(35) NOT NULL default '',
  `codpobla` varchar(6) NOT NULL default '',
  `pobclien` varchar(30) NOT NULL default '',
  `proclien` varchar(30) NOT NULL default '',
  `nifclien` varchar(15) NOT NULL default '',
  `wwwclien` varchar(40) default NULL,
  `fechamov` date default NULL,
  `fechaalt` date NOT NULL default '0000-00-00',
  `codactiv` smallint(3) unsigned NOT NULL default '0',
  `codenvio` smallint(3) unsigned default NULL,
  `codagent` smallint(4) unsigned NOT NULL default '0',
  `codforpa` smallint(3) unsigned NOT NULL default '0',
  `diapago1` tinyint(2) unsigned default NULL,
  `diapago2` tinyint(2) unsigned default NULL,
  `diapago3` tinyint(2) unsigned default NULL,
  `codbanco` smallint(4) unsigned default NULL,
  `codsucur` smallint(4) unsigned default NULL,
  `digcontr` char(2) default NULL,
  `cuentaba` varchar(10) default NULL,
  `codmacta` varchar(10) NOT NULL default '',
  `perclie1` varchar(30) default NULL,
  `telclie1` varchar(20) default NULL,
  `faxclie1` varchar(15) default NULL,
  `maiclie1` varchar(40) default NULL,
  `perclie2` varchar(30) default NULL,
  `telclie2` varchar(20) default NULL,
  `faxclie2` varchar(15) default NULL,
  `maiclie2` varchar(40) default NULL,
  `clivario` tinyint(1) unsigned NOT NULL default '0',
  `tipoiva` tinyint(1) unsigned NOT NULL default '0',
  `tipofact` tinyint(1) unsigned NOT NULL default '0',
  `albarcon` tinyint(1) unsigned NOT NULL default '0',
  `periodof` tinyint(1) NOT NULL default '0',
  `numrepet` tinyint(1) unsigned default NULL,
  `mesnogir` tinyint(2) unsigned default NULL,
  `diavtoat` tinyint(2) unsigned default NULL,
  `codtarif` smallint(3) unsigned NOT NULL default '0',
  `dtoppago` decimal(4,2) NOT NULL default '0.00',
  `dtognral` decimal(4,2) NOT NULL default '0.00',
  `promocio` tinyint(1) unsigned NOT NULL default '0',
  `codsitua` smallint(2) unsigned NOT NULL default '0',
  `referobl` tinyint(1) unsigned NOT NULL default '0',
  `cliabono` tinyint(1) unsigned NOT NULL default '0',
  `kilometr` smallint(5) unsigned default '0',
  `limcredi` decimal(12,2) default NULL,
  `fechaulr` date default NULL,
  `pasclien` varchar(20) NOT NULL default '',
  `observac` text,
  `tasareciclado` tinyint(4) NOT NULL default '0',
  `enviocorreo` tinyint(4) default '1' COMMENT 'Por si va en etiq y envio de cartas',
  `gasAdm` decimal(6,2) default NULL,
  PRIMARY KEY  (`codclien`),
  KEY `fkClientesCodactiv` (`codactiv`),
  KEY `fkClientesCodenvio` (`codenvio`),
  KEY `fkClientesCodagent` (`codagent`),
  KEY `fkClientesCodforpa` (`codforpa`),
  KEY `fkClientesCodtarif` (`codtarif`),
  KEY `fkClientesCodsitua` (`codsitua`),
  KEY `iclien1` (`nomclien`),
  KEY `iclien2` (`nomcomer`),
  KEY `iclien3` (`nifclien`),
  CONSTRAINT `scliente_ibfk_1` FOREIGN KEY (`codactiv`) REFERENCES `sactiv` (`codactiv`),
  CONSTRAINT `scliente_ibfk_2` FOREIGN KEY (`codenvio`) REFERENCES `senvio` (`codenvio`),
  CONSTRAINT `scliente_ibfk_5` FOREIGN KEY (`codagent`) REFERENCES `sagent` (`codagent`),
  CONSTRAINT `scliente_ibfk_6` FOREIGN KEY (`codforpa`) REFERENCES `sforpa` (`codforpa`),
  CONSTRAINT `scliente_ibfk_7` FOREIGN KEY (`codtarif`) REFERENCES `starif` (`codlista`),
  CONSTRAINT `scliente_ibfk_8` FOREIGN KEY (`codsitua`) REFERENCES `ssitua` (`codsitua`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

