/*Table structure for table `scrmacciones` */

CREATE TABLE `scrmacciones` (
  `usuario` varchar(20) NOT NULL,
  `fechora` datetime NOT NULL,
  `codclien` int(11) NOT NULL,
  `agente` smallint(6) default NULL,
  `codtraba` smallint(6) NOT NULL,
  `estado` tinyint(4) NOT NULL default '0' COMMENT 'pendiente,en curso finalizada',
  `tipo` int(11) NOT NULL COMMENT 'foreing key a tipo crm',
  `medio` varchar(35) NOT NULL COMMENT 'telefono,mail,fax,carta,otros',
  `observaciones` text,
  PRIMARY KEY  (`usuario`,`fechora`,`codclien`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

