  `cuerpo` text,
  `adjuntos` varchar(255) default NULL,
  `formato` tinyint(4) default '0' COMMENT '0.SinEsp 1tex 3 rich 2 ht',
  PRIMARY KEY  (`codclien`,`entryID`,`enviado`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

