/*Table structure for table `sprvar` */

CREATE TABLE `sprvar` (
  `nifprove` varchar(9) NOT NULL default '',
  `nomprove` varchar(40) NOT NULL default '',
  `domprove` varchar(30) default NULL,
  `codpobla` varchar(6) default NULL,
  `pobprove` varchar(30) default NULL,
  `proprove` varchar(30) default NULL,
  `telprov2` varchar(15) default NULL,
  PRIMARY KEY  (`nifprove`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `sprvar` */

/*Table structure for table `srecom` */

CREATE TABLE `srecom` (
  `codtipom` char(3) NOT NULL default '0',
  `numfactu` mediumint(7) unsigned NOT NULL default '0',
  `fecfactu` date NOT NULL default '0000-00-00',
  `codtipar` char(2) NOT NULL default '',
  `nomtipar` varchar(25) NOT NULL default '',
  `cantidad` decimal(12,2) NOT NULL default '0.00',
  PRIMARY KEY  (`codtipom`,`numfactu`,`fecfactu`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srecom` */

/*Table structure for table `sserie` */

CREATE TABLE `sserie` (
  `numserie` varchar(15) NOT NULL default '',
  `codartic` varchar(16) NOT NULL default '',
  `codtipar` char(2) NOT NULL default '',
  `codclien` int(6) unsigned default NULL,
  `coddirec` smallint(3) unsigned default NULL,
  `tieneman` tinyint(1) unsigned default '0',
  `nummante` varchar(10) default NULL,
  `ultrepar` date default NULL,
  `fingaran` date default NULL,
  `codtipom` char(3) default NULL,
  `numfactu` mediumint(7) unsigned default NULL,
  `fechavta` date default NULL,
  `numalbar` mediumint(7) unsigned default NULL,
  `numline1` smallint(5) unsigned default NULL,
  `codprove` int(6) unsigned default NULL,
  `numalbpr` varchar(10) default NULL,
  `fechacom` date default NULL,
  `numline2` smallint(5) unsigned default NULL,
  `numsersu` varchar(15) default NULL,
  `fechabaja` date default NULL,
  `codmotba` smallint(2) unsigned default NULL COMMENT 'cod. motivo de baja',
  PRIMARY KEY  (`numserie`,`codartic`),
  KEY `indCodartic` (`codartic`),
